import React, { Component } from 'react';
import {Vote} from './Vote'

const language_list = ["JavaScript", "Python", "Go", "Java", "TypeScript", "Ruby", "Elixir"];

export class Voting extends Component {

	state = { count: 0, name: props.name }

	constructor() {
		super();


	}

	incrementCount = () => {
		this.setState({ count: this.state.count + 1 })
	}

	render() {
		return (
			<div className="languages"> <div className="title">Vote for a language</div>
				{ language_list.map(language => (<Vote name={language} />))}
			</div>

		);
	}
}
